import React from "react";
import "./RequestConfirmation.css";
import image from "./image 1.png"; // Use the actual image path

const ResetPasswordConfirmation = () => {
  return (
    <div className="reset-container">
      <div className="background"></div>
      <div className="reset-box">
        {/* Left Side - Text */}
        <div className="reset-form">
          <h2>Forgot Password?</h2>
          <p>Instructions to reset your password have been sent to your email.</p>
          <button className="reset-btn">Resend Email</button>
          <button className="login-btn">
            <a href="/signin">Go Back to Login</a>
          </button>
        </div>

        {/* Right Side - Image */}
        <div className="reset-image">
          <img src={image} alt="Reset Password" />
        </div>
      </div>
    </div>
  );
};

export default ResetPasswordConfirmation;
